import React, { Fragment } from "react";
import { Card, CardMedia } from "@material-ui/core";

const LeftPane = () => {
  return (
    <Fragment>
      <Card>
        <CardMedia
          style={{ height: "100%", padding: "10%" }}
          image="data:image/jpeg;base64,"
        />
      </Card>
    </Fragment>
  );
};

export default LeftPane;
